import React, { useEffect, useState, useContext } from 'react';
import Navbar from '../components/Navbar';
import api, { advertisementService } from '../services/api';
import './Profile.css';
import { AuthContext } from '../context/AuthContext';

const Profile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [myAds, setMyAds] = useState([]);
  const [myRentedAds, setMyRentedAds] = useState([]);
  const [adsLoading, setAdsLoading] = useState(true);
  const { isLoggedIn } = useContext(AuthContext);

  // Token'dan username'i decode etmek için basit bir JWT decode fonksiyonu
  function parseJwt(token) {
    try {
      return JSON.parse(atob(token.split('.')[1]));
    } catch (e) {
      return null;
    }
  }

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const token = localStorage.getItem('token');
        let username = '';
        if (token) {
          const decoded = parseJwt(token);
          username = decoded?.sub;
        }
        if (!username) {
          setUser(null);
          setLoading(false);
          return;
        }
        // Query parametresi ile GET isteği
        const response = await api.get(`/user/profile?username=${username}`);
        setUser(response.data);
      } catch (error) {
        setUser(null);
      } finally {
        setLoading(false);
      }
    };

    const fetchAds = async () => {
      try {
        const [myAdsRes, myRentedAdsRes] = await Promise.all([
          advertisementService.getMyAds(),
          advertisementService.getMyRentedAds()
        ]);

        setMyAds(myAdsRes.data || []);
        setMyRentedAds(myRentedAdsRes.data || []);
      } catch (error) {
        console.error('İlanlar yüklenirken hata oluştu:', error);
        setMyAds([]);
        setMyRentedAds([]);
      } finally {
        setAdsLoading(false);
      }
    };

    fetchProfile();
    fetchAds();
  }, []);

  const getSafeImageUrl = (url) => {
    const placeholder = 'https://res.cloudinary.com/dqtkblhwr/image/upload/v1720000000/placeholder_car.png';
    if (!url || typeof url !== 'string') return placeholder;
    let u = url.trim();
    if (u.startsWith('http://')) u = u.replace('http://', 'https://');
    if (!u.startsWith('http')) {
      u = `https://res.cloudinary.com/dqtkblhwr/image/upload/${u}`;
    }
    return u;
  };

  if (loading) {
    return (
      <div className="profile-page">
        <Navbar siteName="Nereye" />
        <div className="profile-container">
          <h2>Profil</h2>
          <p>Yükleniyor...</p>
        </div>
      </div>
    );
  }

  if (!user) {
    return (
      <div className="profile-page">
        <Navbar siteName="Nereye" />
        <div className="profile-container">
          <h2>Profil</h2>
          <p>Profil bilgileri alınamadı.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="profile-page" style={{ minHeight: '100vh', background: "url('https://images.unsplash.com/photo-1503376780353-7e6692767b70?auto=format&fit=crop&w=1920&q=80') no-repeat center center/cover", position: 'relative' }}>
      <div className="profile-bg-overlay"></div>
      <Navbar siteName="Nereye" />
      <div className="profile-container">
        <h2 className="profile-title">Profil Bilgilerim</h2>
        <div className="profile-card">
          <div className="profile-row">
            <span className="profile-label">Kullanıcı Adı:</span>
            <span className="profile-value">{user.user_name}</span>
          </div>
          <div className="profile-row">
            <span className="profile-label">Ad:</span>
            <span className="profile-value">{user.first_name}</span>
          </div>
          <div className="profile-row">
            <span className="profile-label">Soyad:</span>
            <span className="profile-value">{user.last_name}</span>
          </div>
          <div className="profile-row">
            <span className="profile-label">E-posta:</span>
            <span className="profile-value">{user.email}</span>
          </div>
          <div className="profile-row">
            <span className="profile-label">Telefon:</span>
            <span className="profile-value">{user.phone_number}</span>
          </div>
        </div>

        {/* İlanlarım Bölümü */}
        <div className="profile-section">
          <h3 className="profile-section-title">İlanlarım</h3>
          {adsLoading ? (
            <p>İlanlar yükleniyor...</p>
          ) : myAds.length === 0 ? (
            <p>Henüz ilan vermemişsiniz.</p>
          ) : (
            <div className="ads-grid">
              {myAds.map((ad) => {
                const name = `${ad.car?.brand?.brand_name || ad.car?.brand?.name || ''} ${ad.car?.model || ''}`.trim();
                return (
                  <div key={ad.ad_id} className="ad-card">
                    <img
                      src={getSafeImageUrl(ad.car?.img_url)}
                      alt={name}
                      className="ad-image"
                      onError={(e) => { e.currentTarget.src = getSafeImageUrl(''); }}
                    />
                    <div className="ad-details">
                      <h4>{name}</h4>
                      <p className="ad-price">{ad.daily_price} TL / günlük</p>
                      <p className="ad-status">
                        {ad.tenet_id ? 'Kiralanmış' : 'Müsait'}
                      </p>
                    </div>
                  </div>
                );
              })}
            </div>
          )}
        </div>

        {/* Kiraladığım Araçlar Bölümü */}
        <div className="profile-section">
          <h3 className="profile-section-title">Kiraladığım Araçlar</h3>
          {adsLoading ? (
            <p>Kiraladığınız araçlar yükleniyor...</p>
          ) : myRentedAds.length === 0 ? (
            <p>Henüz araç kiralamamışsınız.</p>
          ) : (
            <div className="ads-grid">
              {myRentedAds.map((ad) => {
                const name = `${ad.car?.brand?.brand_name || ad.car?.brand?.name || ''} ${ad.car?.model || ''}`.trim();
                return (
                  <div key={ad.ad_id} className="ad-card">
                    <img
                      src={getSafeImageUrl(ad.car?.img_url)}
                      alt={name}
                      className="ad-image"
                      onError={(e) => { e.currentTarget.src = getSafeImageUrl(''); }}
                    />
                    <div className="ad-details">
                      <h4>{name}</h4>
                      <p className="ad-price">{ad.daily_price} TL / günlük</p>
                      <p className="ad-status rented">Kiralanmış</p>
                    </div>
                  </div>
                );
              })}
            </div>
          )}
        </div>

        <button className="profile-logout-btn" onClick={() => { if(window.confirm('Çıkış yapmak istiyor musunuz?')) { localStorage.removeItem('token'); window.location.href = '/login'; } }}>Çıkış Yap</button>
      </div>
    </div>
  );
};

export default Profile;
